import { React, useState } from "react";
import { Col, Form, Row } from "react-bootstrap";
import { NavLink } from "react-router-dom";
import DoctorMenu from "../../../components/layout/DoctorMenu";

const Step1 = () => {
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    suffix: "",
    dob: "",
    age: "",
    gender: "Male",
    feet: "",
    inch: "",
    dominantHand: "Right",
    guardianFirstName: "",
    guardianLastName: "",
    guardianSuffix: "",
    organization: "Org 1",
    email: "",
    phone: "",
    address: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    console.log("Submitting Form:", formData);
  };

  return (
    <DoctorMenu>
      <div className="mt-5 client-form">
        <h3>Client Information</h3>
        <Form onSubmit={handleSubmit} className="mt-4">
          <Row>
            <Col md={6}>
              <Form.Group controlId="firstName" className="form-cont">
                <Form.Label className="text-black">First Name</Form.Label>
                <Form.Control
                  type="text"
                  placeholder="Enter First Name"
                  name="firstName"
                  value={formData.firstName}
                  onChange={handleChange}
                />
              </Form.Group>
            </Col>
            <Col md={6}>
              <Form.Group controlId="lastName" className="form-cont">
                <Form.Label className="text-black">Last Name</Form.Label>
                <Form.Control
                  type="text"
                  placeholder="Enter Last Name"
                  name="lastName"
                  value={formData.lastName}
                  onChange={handleChange}
                />
              </Form.Group>
            </Col>
          </Row>
          <Row>
            <Col md={6}>
              <Form.Group controlId="suffix" className="form-cont">
                <Form.Label className="text-black">Suffix</Form.Label>
                <Form.Control
                  type="text"
                  placeholder="Enter suffix"
                  name="suffix"
                  value={formData.suffix}
                  onChange={handleChange}
                />
              </Form.Group>
            </Col>
            <Col md={6}>
              <Form.Group controlId="customerDate" className="form-cont">
                <Form.Label className="text-black">Date Of Birth</Form.Label>
                <Form.Control
                  type="date"
                  name="dob"
                  value={formData.dob}
                  onChange={handleChange}
                />
              </Form.Group>
            </Col>
          </Row>
          <Row>
            {/* ... (similar modifications for other Form.Group components) */}
          </Row>
          <Row>
            <Col md={6}>
              <Form.Group controlId="zip" className="form-cont">
                <Form.Label className="text-black">ZIP</Form.Label>
                <Form.Control
                  type="email"
                  placeholder="Enter ZIP"
                  name="zip"
                  value={formData.zip}
                  onChange={handleChange}
                />
              </Form.Group>
            </Col>
            <Col md={6}>
              <NavLink
                type="submit"
                className="purple-button"
                style={{ width: "200px" }}
                to="/step2"
              >
                Next
              </NavLink>
            </Col>
          </Row>
        </Form>
      </div>
    </DoctorMenu>
  );
};

export default Step1;

